import React from "react";
import Repository from "./Repository";



const Repositories = props => (
    <React.Fragment>

       { props.repositories.map((repository , index) => {
        return (
            <React.Fragment key= { index }>
                <h2> { repository.name }</h2>
                <h3>Commits</h3>

                { repository.commits.forEach(element => {
                <ul>
                    <li>element.url</li>
                    <a href= { element.html_url } >See on Github</a>
                </ul>
                }) }

                <a href= { repository.link } >See on Github</a>
            </React.Fragment>
        )
    })
    }
    </React.Fragment>
)


export default Repositories
